     wxString msg;
	    const wxChar *class_info = wxT("unknown");
	    if(refd->type < 10) {
		wxClassInfo *cinfo = ((wxObject *)ptr)->GetClassInfo();
		    class_info = cinfo->GetClassName();
	       }
      msg.Printf(wxT("Deleting {wx_ref, %d, %s} at %p "), refd->ref, class_info, ptr);
      send_msg("debug", &msg);
